import React, { useState } from "react";
import "./Skill.css";

const Skill = () => {
  // 기능 구현 로직
  const [state, setState] = useState(true);
  const [back, setBack] = useState(true);

  const button1st = () => {
    setState(!state);
    console.log("button01");
  };
  const button2nd = () => {
    setBack(!back);
    console.log("button02");
  };

  return (
    <div id="skill">
      <div class="Skill">
        <h1>Skills</h1>
        <div class="box-wraper">
          <div class="box">
            <div class="text-box">
              <button class="btn" onClick={button1st}>
                {state ? (
                  <span>state</span>
                ) : (
                  <span>
                    프로젝트에 적용 가능하며
                    <br /> 가장 많이 사용하는 기술
                  </span>
                )}
              </button>
              <p>Front-End</p>
              <div>HMTL/CSS</div>
              <div>Javascript(ES6)</div>
              <div>React</div>
              <div>Redux</div>
            </div>
            <div>
              <button class="btn" onClick={button2nd}>
                {back ? (
                  <span>state</span>
                ) : (
                  <span>
                    Back-End를 이해하기 위해
                    <br /> 개념에 대해 학습했습니다
                  </span>
                )}
              </button>
              <p>Back-End</p>
              <div>Node.JS</div>
              <div>REST API</div>
              <div>MySQL</div>
            </div>
          </div>

          <div class="box">
            <div class="text-box">
              <button class="btn" onClick={button3th}>
                state
              </button>
              <p>Etc</p>
              <div>Github</div>
              <div>NPM</div>
              <div>ESLint</div>
              <div>AWS</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Skill;
